script: |
  super -f text -I q9808.spq | sort > q9808.out

inputs:
  - name: q9808.spq
    data: |
      SELECT 20 * ( 47 ) AS col2 FROM tab2 (FORMAT parquet) WHERE NOT - col2 BETWEEN + - col2 * - ( col2 ) + + col0 * 65 AND col2 + + col2 * + col1;
  - name: tab2

outputs:
  - name: q9808.out
    data: |
      940
      940
      940
